[{"location":"elt/#ELT.jl","page":"ELT vs ETL","title":"ELT.jl","text":"","category":"section"},{"location":"elt/","page":"ELT vs ETL","title":"ELT vs ETL","text":"ETL Data Warehouse vs ELT Data Lake debate, is like vim vs emacs, linux vs windows never ending discussions.","category":"page"},{"location":"elt/","page":"ELT vs ETL","title":"ELT vs ETL","text":"It means different things and may represent different concepts, but end of the day leads to one conclusion.","category":"page"},{"location":"elt/","page":"ELT vs ETL","title":"ELT vs ETL","text":"Data is a mineral, if you handle it with care and delicacy, polish and move it to a fine safe enclosure, it will age as fine gold. - Amit Shukla","category":"page"},{"location":"elt/","page":"ELT vs ETL","title":"ELT vs ETL","text":"In the following lessons, we will discuss different strategies to Extract, Transform, Load data from different sources to different enclosures.","category":"page"},{"location":"elt/","page":"ELT vs ETL","title":"ELT vs ETL","text":"Why this package? There are a dozen ETL/ELT and Data warehouse/ Data lake solutions available in the market today. All of them are extremely capable of extraction, load and transforming almost any type of data structure like structured, un-structured, binary, BLOB, sound, image or simple text in large quantities.","category":"page"},{"location":"elt/","page":"ELT vs ETL","title":"ELT vs ETL","text":"This package neither challenges or aims to build anything different. . Instead, this package will use existing RDBMS, DataLakes, or Document databases available in the market.","category":"page"},{"location":"elt/","page":"ELT vs ETL","title":"ELT vs ETL","text":"This package should be seen as providing a DataType environment, where we can first understand and define subject data structure, then do ELT operations on it. This is what I meant earlier by saying handle with care and delicacy.","category":"page"},{"location":"elt/","page":"ELT vs ETL","title":"ELT vs ETL","text":"Inheriting behavior is much more important than being able to inherit structure.","category":"page"},{"location":"elt/","page":"ELT vs ETL","title":"ELT vs ETL","text":"Just to give an example, Normally, we ingest all vendor tables/transactions into a Date warehouse or Data lake or any self-service environment, and then let SMEs run meaningful analytics on it. instead, Lets first define a Vendor DataType and then build ELT or ETL operations on it. This simple concept will age your data to fine gold and SME enjoy back seat ride on driverless AI.","category":"page"},{"location":"elt/","page":"ELT vs ETL","title":"ELT vs ETL","text":"Another example is,  Instead of loading all your accounting data into RDBMS tables, developers take time to pre-define an accounting Data Structure such as JOURNALS, LEDGER, ACCOUNTINGLINES, CHARTFIELDs and HIERARCHY data types, then ELTdata into these Data Structures and push it to the reporting database. This will lead to a much powerful driverless self-service live reporting/ predictive analytics environment.","category":"page"},{"location":"elt/","page":"ELT vs ETL","title":"ELT vs ETL","text":"In the following chapters, we will build ELT strategies.","category":"page"},{"location":"elt/#Extract","page":"ELT vs ETL","title":"Extract","text":"","category":"section"},{"location":"elt/#Load","page":"ELT vs ETL","title":"Load","text":"","category":"section"},{"location":"elt/#Transform","page":"ELT vs ETL","title":"Transform","text":"","category":"section"},{"location":"elt/","page":"ELT vs ETL","title":"ELT vs ETL","text":"Let's get started.","category":"page"},{"location":"tax/#About-Taxes","page":"About Taxes","title":"About Taxes","text":"","category":"section"},{"location":"tax/","page":"About Taxes","title":"About Taxes","text":"Taxes are monetary charges collected by governments to fund building, maintaining and growth infrastructure. These taxes are imposed on Individuals and organizations.","category":"page"},{"location":"tax/","page":"About Taxes","title":"About Taxes","text":"The scope of this package is limited to tax analytics for organizations only.","category":"page"},{"location":"tax/","page":"About Taxes","title":"About Taxes","text":"Problem Statement: ","category":"page"},{"location":"tax/","page":"About Taxes","title":"About Taxes","text":"Often vendor invoices are inclusive of sales, use, freight and other taxes on Good & Services offered.","category":"page"},{"location":"tax/","page":"About Taxes","title":"About Taxes","text":"However, due to various laws and tax exemption available, buyers are overcharged.  Larger the organization, bigger the over accrued tax amounts are.","category":"page"},{"location":"tax/","page":"About Taxes","title":"About Taxes","text":"Organizations bear huge costs to sort, correct and claim these over accrued invoices, taxes and spend tremendous amounts of time and money to correct these invoices which could have been prevented at ingestion point.","category":"page"},{"location":"tax/","page":"About Taxes","title":"About Taxes","text":"This package addresses the above problem statement.","category":"page"},{"location":"tax/","page":"About Taxes","title":"About Taxes","text":"TaxAnalytics.jl package is used to automate loading, sorting, finding patterns and mis-match on such Vendor or Accounts Payable transactions.","category":"page"},{"location":"tax/","page":"About Taxes","title":"About Taxes","text":"Further, TaxAanlytics.jl package can be used as a platform to build live, ad-hoc, analytics, advance visualization and data science operations on Accounts Payable data.","category":"page"},{"location":"tax/","page":"About Taxes","title":"About Taxes","text":"This package helps load data from various structured and unstructured data to a unified platform and build an advanced self-service reporting & analytic environment.","category":"page"},{"location":"#TaxAnalytics.jl","page":"Introduction","title":"TaxAnalytics.jl","text":"","category":"section"},{"location":"","page":"Introduction","title":"Introduction","text":"TaxAnalytics Julia package provide a unified Analytics platform to support data analytical operations on all sort of Vendor, Use, Freight, Misc Tax Accruals data.","category":"page"},{"location":"","page":"Introduction","title":"Introduction","text":"Objective: TaxAnalytics package is one complete solution to address complete Tax data wrangling operations.","category":"page"},{"location":"","page":"Introduction","title":"Introduction","text":"This package will provide a complete Analytic Software package, which can be deployed as a bolt-on or independent application for all data extract, load, transformation, ad-hoc reporting & Analytics, visualizations and tooling to support Data Science, AI, ML predictive Analytics.","category":"page"},{"location":"","page":"Introduction","title":"Introduction","text":"This package is intended for small, medium, large and very Big Organizations who require a Big Data Tools which can ELT i.e. Extract very large amount of structured and unstructured data, load data into a uniform platform such as RDBMS, Hadoop Data Lake or non-SQL environment.","category":"page"},{"location":"","page":"Introduction","title":"Introduction","text":"info: Info\nPlatform: Oracle OCI, AWS, Google or Microsoft Azure data cloud. Analytics: Power BI, Tableau, Oracle Analytics Cloud or Kibana ELT/ETL: Ascential Datastage, Informatica, Ab Initio Programming/Framework: Python, Julia, JuliaDB, Pytorch, TensorFlow or Flux","category":"page"},{"location":"","page":"Introduction","title":"Introduction","text":"Further, advance data transformation wrangling techniques can be applied to prepare data for operations reporting, data analytic, advance data visualizations, data science operations including AI, ML for predictions.","category":"page"},{"location":"","page":"Introduction","title":"Introduction","text":"This package also show case reporting, visualizations to support real time, live reporting on all mobile, web devices. ","category":"page"},{"location":"","page":"Introduction","title":"Introduction","text":"info: Info\nAuthor: Amit Shukla Last Update Date: Jan 25, 2021 Who should read this: small, medium, large ERP Consultants Version: 0.22 Consulting: info@elishconsulting.com Sponsorship: open for funding","category":"page"},{"location":"","page":"Introduction","title":"Introduction","text":"","category":"page"},{"location":"","page":"Introduction","title":"Introduction","text":"Business Process diagram","category":"page"},{"location":"","page":"Introduction","title":"Introduction","text":"(Image: Business Process Diagram)","category":"page"},{"location":"","page":"Introduction","title":"Introduction","text":"Technical Process Diagram","category":"page"},{"location":"","page":"Introduction","title":"Introduction","text":"(Image: Tech Process Diagram)","category":"page"},{"location":"","page":"Introduction","title":"Introduction","text":"","category":"page"},{"location":"","page":"Introduction","title":"Introduction","text":"note: Note\nERP Systems- Oracle, PeopleSoft, SAP, Intuit etc.","category":"page"},{"location":"","page":"Introduction","title":"Introduction","text":"","category":"page"},{"location":"","page":"Introduction","title":"Introduction","text":"Pages = [\"tax.md\", \"elt.md\"]\nDepth = 3","category":"page"},{"location":"","page":"Introduction","title":"Introduction","text":"Table of Contents:","category":"page"},{"location":"","page":"Introduction","title":"Introduction","text":"About Taxes\nETL or ETL\nself service data analysis\nData Visualization\nData Science Operations\np-value Null hypothesis tests\nFeature Engineering\nML Models\nLive Reporting\nPredictive analytic","category":"page"},{"location":"","page":"Introduction","title":"Introduction","text":"!!! info ERP Systems     Oracle, PeopleSoft, SAP, Tally, Intuit, QuickBooks etc.     I will cover examples from ERP Domains like GL (General Ledger), AP (Accounts Payable), AR (Account Receivables), B2P (Buy to Pay), Expense, Travel & Time, HCM Human Capital Management, CRM etc.","category":"page"}]
